INSERT INTO public.moves VALUES ('MOVE_DOUBLE_TEAM', 'Double Team', 'normal', 'Creates illusionary copies of the user. The copies disorient the enemy, reducing its accuracy.', NULL, 100, 15, NULL);
INSERT INTO public.moves VALUES ('MOVE_BIDE', 'Bide', 'normal', 'The user waits for several turns. At the end, it returns double the damage it received.', NULL, 100, 10, NULL);
INSERT INTO public.moves VALUES ('MOVE_CUT', 'Cut', 'normal', 'A NORMAL-type attack. Also used for cutting small bushes to open new paths.', 50, 95, 30, NULL);
INSERT INTO public.moves VALUES ('MOVE_FIRE_BLAST', 'Fire Blast', 'fire', 'The strongest FIRE-type attack. Has a one-in-three chance of inflicting a burn on the target.', 120, 85, 5, 33);
INSERT INTO public.moves VALUES ('MOVE_STRENGTH', 'Strength', 'normal', 'A very powerful NORMAL-type attack. Also used for moving obstacles like boulders.', 80, 100, 15, NULL);
INSERT INTO public.moves VALUES ('MOVE_FISSURE', 'Fissure', 'ground', 'Causes a single-hit knockout if it hits. Useless against FLYING-type Pokémon.', NULL, 30, 5, NULL);
INSERT INTO public.moves VALUES ('MOVE_FLY', 'Fly', 'flying', 'The Pokémon flies high, then strikes in the next turn. Used for flying to places already visited.', 70, 95, 15, NULL);
INSERT INTO public.moves VALUES ('MOVE_BUBBLE_BEAM', 'Bubble Beam', 'water', 'A WATER-type attack. Has a one-in-three chance of reducing the target''s SPEED.', 65, 100, 20, 33);
INSERT INTO public.moves VALUES ('MOVE_SURF', 'Surf', 'water', 'A WATER-type attack. The power of this technique is strong and highly accurate.', 95, 100, 15, NULL);
INSERT INTO public.moves VALUES ('MOVE_RAZOR_WIND', 'Razor Wind', 'normal', 'A two-turn attack with the wind attack in the second turn. Learned by many FLYING-type Pokémon.', 80, 74.6, 10, NULL);
INSERT INTO public.moves VALUES ('MOVE_THUNDERBOLT', 'Thunderbolt', 'electric', 'An ELECTRIC-type attack. Has a one-in-ten chance of paralyzing the target.', 95, 100, 15, 10);
INSERT INTO public.moves VALUES ('MOVE_ROCK_SLIDE', 'Rock Slide', 'rock', 'A ROCK-type attack that hits the target with an avalanche of rocks and boulders.', 75, 90, 10, NULL);
INSERT INTO public.moves VALUES ('MOVE_FLASH', 'Flash', 'normal', 'Creates a brilliant flash of light that blinds the target. This technique reduces the opponent''s accuracy.', NULL, 70, 20, NULL);
INSERT INTO public.moves VALUES ('MOVE_PSYWAVE', 'Psywave', 'psychic', 'A PSYCHIC-type attack of varying intensity. It occasionally inflicts heavy damage.', NULL, 80, 15, NULL);
INSERT INTO public.moves VALUES ('MOVE_EGG_BOMB', 'Egg Bomb', 'normal', 'A NORMAL-type attack. An egg is launched at the target. It may miss, however.', 100, 75, 10, NULL);
INSERT INTO public.moves VALUES ('MOVE_BONE_CLUB', 'Bone Club', 'ground', 'A physical attack using a bone as a club. If it connects, it may cause the target to flinch.', 65, 85, 20, 10);
INSERT INTO public.moves VALUES ('MOVE_BONEMERANG', 'Bonemerang', 'ground', 'A boomerang made of bone is thrown to inflict damage twice -- on the way out and on its return.', 50, 90, 10, NULL);
INSERT INTO public.moves VALUES ('MOVE_SOFT-BOILED', 'Soft-Boiled', 'normal', 'Restores HP by 1/2 of the user''s maximum HP. May also be used in the field.', NULL, 100, 10, NULL);
